import React from 'react';

const PortfolioItem = props => (
	<div className="wrapper portfolio-wrapper wejsciowka h-100">
		<div className="portfolio-item">
			<p className="tags">{props.name}}</p>
		</div>
	</div>
);

export default PortfolioItem;
